	static HashMap<String, Integer> stoi = new HashMap<>();
	static HashMap<Integer,String> itos = new HashMap<>();

	public static void main(String[] args) throws Exception {
		stoi.put("ZRO", 0);
		stoi.put("ONE", 1);
		stoi.put("TWO", 2);
		stoi.put("THR", 3);
		stoi.put("FOR", 4);
		stoi.put("FIV", 5);
		stoi.put("SIX", 6);
		stoi.put("SVN", 7);
		stoi.put("EGT", 8);
		stoi.put("NIN", 9);

		itos.put(0, "ZRO");
		itos.put(1, "ONE");
		itos.put(2, "TWO");
		itos.put(3, "THR");
		itos.put(4, "FOR");
		itos.put(5, "FIV");
		itos.put(6, "SIX");
		itos.put(7, "SVN");
		itos.put(8, "EGT");
		itos.put(9, "NIN");

		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		int TC = Integer.parseInt(br.readLine());
		StringBuilder sb = new StringBuilder();
		for (int t = 0; t < TC; ++t) {
			StringTokenizer st = new StringTokenizer(br.readLine(), " ");
			String front = st.nextToken();
			int N = Integer.parseInt(st.nextToken());
			st = new StringTokenizer(br.readLine(), " ");
			int[] cnt = new int[10];
			for (int i = 0; i < N; ++i) {
				cnt[stoi.get(st.nextToken())]++;
			}
			sb.append(front).append(' ').append('\n');
			for (int i = 0; i < 10; ++i) {
				if (cnt[i] > 0) {
					for(int j=0;j<cnt[i];++j)
						sb.append(itos.get(i)).append(' ');
				}
			}
			sb.append('\n');
		}
		System.out.println(sb.toString());
	}
